03.03.2020 Chop etish versiyasi
Talabalarga kontrakt pulini 4 ga boʻlib toʻlash imkoni beriladi
2017–2021-yillarda Oʻzbekiston Respublikasini rivojlantirishning beshta ustuvor yoʻnalishi boʻyicha Harakatlar strategiyasini “Ilm, maʼrifat va raqamli iqtisodiyotni rivojlantirish yili”da amalga oshirishga oid davlat dasturi toʻgʻrisida” Prezident Farmoniga muvofiq:
2020-yil oxiriga qadar 6 yoshli bolalarni maktabga tayyorlash tizimi joriy etiladi, maktabgacha taʼlim bilan qamrab olish darajasi 60 foizga yetkaziladi;
2020-yil 1-sentyabrdan boshlab alohida umumtaʼlim muassasalarida bolalarni maktab fanlariga elektron oʻqitish boʻyicha axborot tizimlari qogʻoz hujjatlarni bekor qilgan holda tajriba tariqasida joriy etiladi;
2020/2021 oʻquv yilidan boshlab:
Oʻzbekiston OTMlariga davlat granti asosida oʻqishga qabul qilish boʻyicha kvota bosqichma-bosqich 2 baravarga oshiriladi;
respublika OTMlari talabalariga oʻquv yili davomida teng ulushlarda kamida 4 marotaba oʻqish uchun toʻlovlarni amalga oshirish imkoniyati taqdim etiladi;
2020-yilda matematika, kimyo-biologiya, geologiya kabi yoʻnalishlarda fundamental va amaliy tadqiqotlar faollashtiriladi.
